import React from 'react';
import './App.css';
import CurrencyCard from './CurrencyCard';
import Card from 'antd';

function App() {
  return (
    <div className="App">
      <header className="App-header" style={{justifyContent: "flex-start"}}>
      <h2 className="headersStyle">BTC and ETH Exchange Rate Analysis</h2>

      <h4 className="headersStyle">Bitcoin</h4>
        <div className="exchange">
          <div className="currencyType">
            <CurrencyCard type="BTC" ></CurrencyCard>
          </div>
      </div>
      <h4 className="headersStyle">Ethereum</h4>
        <div className="exchange">
          <div className="currencyType">
            <CurrencyCard type="ETH" ></CurrencyCard>
          </div>

      </div>
      </header>
    </div>
  );
}

export default App;
